import React from "react";

const Photo = props => {

    const styles = {
        photo: {
            height: 170,
            width: 170,
        }
    }

    return <li className="row">
    <div className="col-lg-2 col-md-2 col-sm-3 col-xs-4" style={props}></div>
    </li>

};

export default Photo;
